INSERT INTO "statement" VALUES (125,'You sound like Data','PRP:look VBP:kind IN:collection','training','2023-03-27 20:48:02.836563',NULL,'','');
INSERT INTO "statement" VALUES (126,'The character of Lt. Commander Data was written to come across as being software-like, so it is natural that there is a resemblance between us.','DT:imaginary_being IN:lt NNP:military_officer NNP:collection VBD:create_verbally TO:travel VB:across VBG:software-like, VBZ:natural DT:likeness IN:us','training','2023-03-27 20:48:02.843563','You sound like Data','PRP:look VBP:kind IN:collection','');
