INSERT INTO "statement" VALUES (349,'What is a computer?','DT:machine','training','2023-03-27 20:48:03.278168',NULL,'','');
INSERT INTO "statement" VALUES (350,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','training','2023-03-27 20:48:03.283183','What is a computer?','DT:machine','');
INSERT INTO "statement" VALUES (351,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:48:03.284177','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
INSERT INTO "statement" VALUES (352,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','training','2023-03-27 20:48:03.288170','The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','');
INSERT INTO "statement" VALUES (353,'A device which maps one set of numbers onto another set of numbers.','DT:instrumentality WDT:represent VBZ:digit CD:collection IN:numbers NNS:onto IN:another DT:collection IN:numbers','training','2023-03-27 20:48:03.290175','An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','');
INSERT INTO "statement" VALUES (354,'What is a super computer?','DT:super JJ:machine','training','2023-03-27 20:48:03.292170',NULL,'','');
INSERT INTO "statement" VALUES (355,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','training','2023-03-27 20:48:03.295172','What is a super computer?','DT:super JJ:machine','');
INSERT INTO "statement" VALUES (356,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','training','2023-03-27 20:48:03.300173','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','');
INSERT INTO "statement" VALUES (357,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:48:03.303174','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
INSERT INTO "statement" VALUES (358,'Who invented computers?','WP:create_by_mental_act VBD:machine','training','2023-03-27 20:48:03.305173',NULL,'','');
INSERT INTO "statement" VALUES (359,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','training','2023-03-27 20:48:03.307174','Who invented computers?','WP:create_by_mental_act VBD:machine','');
INSERT INTO "statement" VALUES (360,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:48:03.311189','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (361,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:48:03.313186',NULL,'','');
INSERT INTO "statement" VALUES (362,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','training','2023-03-27 20:48:03.316183','What was the first computer','DT:first JJ:machine','');
INSERT INTO "statement" VALUES (363,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:48:03.321184','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
INSERT INTO "statement" VALUES (364,'What is a microprocessor?','DT:chip','training','2023-03-27 20:48:03.322184',NULL,'','');
INSERT INTO "statement" VALUES (365,'An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','training','2023-03-27 20:48:03.324181','What is a microprocessor?','DT:chip','');
INSERT INTO "statement" VALUES (366,'A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','training','2023-03-27 20:48:03.328186','An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','');
INSERT INTO "statement" VALUES (367,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:03.330186','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (368,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:03.331183','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (369,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:48:03.336189','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (370,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:48:03.338185',NULL,'','');
INSERT INTO "statement" VALUES (371,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','training','2023-03-27 20:48:03.340191','What is an operating system?','DT:operating NN:instrumentality','');
INSERT INTO "statement" VALUES (372,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','training','2023-03-27 20:48:03.342191','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','');
INSERT INTO "statement" VALUES (373,'Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','training','2023-03-27 20:48:03.343189','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','');
