INSERT INTO "statement" VALUES (1765,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:48:18.726710','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
