INSERT INTO "statement" VALUES (1771,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:48:18.745715','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
