INSERT INTO "statement" VALUES (1773,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','training','2023-03-27 20:48:18.748715','Who invented computers?','WP:create_by_mental_act VBD:machine','');
INSERT INTO "statement" VALUES (1774,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:48:18.753716','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (1775,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:48:18.754717',NULL,'','');
INSERT INTO "statement" VALUES (1776,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','training','2023-03-27 20:48:18.758719','What was the first computer','DT:first JJ:machine','');
INSERT INTO "statement" VALUES (1777,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:48:18.763720','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
INSERT INTO "statement" VALUES (1778,'What is a microprocessor?','DT:chip','training','2023-03-27 20:48:18.765719',NULL,'','');
INSERT INTO "statement" VALUES (1779,'An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','training','2023-03-27 20:48:18.768724','What is a microprocessor?','DT:chip','');
INSERT INTO "statement" VALUES (1780,'A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','training','2023-03-27 20:48:18.775722','An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','');
INSERT INTO "statement" VALUES (1781,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:18.777723','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (1782,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:18.779722','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (1783,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:48:18.782724','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (1784,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:48:18.784726',NULL,'','');
INSERT INTO "statement" VALUES (1785,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','training','2023-03-27 20:48:18.786724','What is an operating system?','DT:operating NN:instrumentality','');
INSERT INTO "statement" VALUES (1786,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','training','2023-03-27 20:48:18.787725','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','');
INSERT INTO "statement" VALUES (1787,'Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','training','2023-03-27 20:48:18.789724','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','');
INSERT INTO "statement" VALUES (1788,'Software which implements the basic functions of a computer, such as memory access, processes, and peripheral access.','WDT:use DT:basic JJ:mathematical_relation DT:computer, IN:representation NN:access, NN:processes, CC:peripheral JJ:right','training','2023-03-27 20:48:18.791726','Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','');
INSERT INTO "statement" VALUES (1789,'Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','training','2023-03-27 20:48:18.794726',NULL,'','');
INSERT INTO "statement" VALUES (1790,'It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','training','2023-03-27 20:48:18.795726','Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','');
INSERT INTO "statement" VALUES (1791,'I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','training','2023-03-27 20:48:18.797727','It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','');
INSERT INTO "statement" VALUES (1792,'Linux, always Linux!','NNP:always RB:linux','training','2023-03-27 20:48:18.798728','I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','');
