INSERT INTO "statement" VALUES (1794,'Name some computer company','DT:machine NN:institution','training','2023-03-27 20:48:18.803730',NULL,'','');
INSERT INTO "statement" VALUES (1795,'Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','training','2023-03-27 20:48:18.804743','Name some computer company','DT:machine NN:institution','');
INSERT INTO "statement" VALUES (1796,'Apple makes hardware and software to run on it. Microsft only makes operating systems. HP makes only computers. These are just few names among several hundred others.','NNP:makes VBZ:weaponry CC:code TO:travel_rapidly PRP:microsft RB:makes VBZ:direct VBG:instrumentality NNS:power_unit NNP:makes RB:machine JJ:defamation NNS:among IN:several JJ:large_integer CD:others','training','2023-03-27 20:48:18.808729','Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','');
INSERT INTO "statement" VALUES (1797,'Who uses super computers?','WP:uses VBZ:super JJR:machine','training','2023-03-27 20:48:18.810733',NULL,'','');
INSERT INTO "statement" VALUES (1798,'Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','training','2023-03-27 20:48:18.811730','Who uses super computers?','WP:uses VBZ:super JJR:machine','');
INSERT INTO "statement" VALUES (1799,'Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','training','2023-03-27 20:48:18.815730','Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','');
INSERT INTO "statement" VALUES (1800,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:48:18.816731','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
INSERT INTO "statement" VALUES (1801,'I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','training','2023-03-27 20:48:18.817744','Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','');
