INSERT INTO "statement" VALUES (1805,'Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','training','2023-03-27 20:48:18.828734','Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','');
INSERT INTO "statement" VALUES (1806,'Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','training','2023-03-27 20:48:18.830734','Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','');
INSERT INTO "statement" VALUES (1807,'Just like everything it all comes down to math!','RB:kind IN:everything DT:travel TO:math','training','2023-03-27 20:48:18.831735','Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','');
