INSERT INTO "statement" VALUES (1878,'Although practicality beats purity.','IN:utility NN:youth_subculture NNS:condition','training','2023-03-27 20:48:18.957776','Special cases aren''t special enough to break the rules.','JJ:happening VBP:special JJ:enough TO:end DT:concept','');
INSERT INTO "statement" VALUES (1879,'Errors should never pass silently.','MD:never RB:travel VB:silently','training','2023-03-27 20:48:18.959771','Although practicality beats purity.','IN:utility NN:youth_subculture NNS:condition','');
