INSERT INTO "statement" VALUES (1881,'In the face of ambiguity, refuse the temptation to guess.','DT:external_body_part IN:ambiguity, NN:react DT:influence TO:expect','training','2023-03-27 20:48:18.961777','Unless explicitly silenced.','IN:explicitly RB:suppress','');
