INSERT INTO "statement" VALUES (1883,'Although that way may not be obvious at first unless you''re Dutch.','DT:property NN:gregorian_calendar_month VB:obvious IN:first JJ:unless NN:nation','training','2023-03-27 20:48:18.964777','There should be one-- and preferably only one --obvious way to do it.','VB:one-- CC:preferably RB:digit CD:--obvious JJ:property','');
