INSERT INTO "statement" VALUES (3177,'What is a computer?','DT:machine','training','2023-03-27 20:48:34.786718',NULL,'','');
INSERT INTO "statement" VALUES (3178,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','training','2023-03-27 20:48:34.793722','What is a computer?','DT:machine','');
INSERT INTO "statement" VALUES (3179,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:48:34.794720','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
INSERT INTO "statement" VALUES (3180,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','training','2023-03-27 20:48:34.797719','The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','');
INSERT INTO "statement" VALUES (3181,'A device which maps one set of numbers onto another set of numbers.','DT:instrumentality WDT:represent VBZ:digit CD:collection IN:numbers NNS:onto IN:another DT:collection IN:numbers','training','2023-03-27 20:48:34.800722','An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','');
INSERT INTO "statement" VALUES (3182,'What is a super computer?','DT:super JJ:machine','training','2023-03-27 20:48:34.802724',NULL,'','');
INSERT INTO "statement" VALUES (3183,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','training','2023-03-27 20:48:34.806722','What is a super computer?','DT:super JJ:machine','');
INSERT INTO "statement" VALUES (3184,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','training','2023-03-27 20:48:34.811722','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','');
INSERT INTO "statement" VALUES (3185,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:48:34.813726','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
INSERT INTO "statement" VALUES (3186,'Who invented computers?','WP:create_by_mental_act VBD:machine','training','2023-03-27 20:48:34.814725',NULL,'','');
INSERT INTO "statement" VALUES (3187,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','training','2023-03-27 20:48:34.817725','Who invented computers?','WP:create_by_mental_act VBD:machine','');
INSERT INTO "statement" VALUES (3188,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:48:34.821725','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (3189,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:48:34.822733',NULL,'','');
INSERT INTO "statement" VALUES (3190,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','training','2023-03-27 20:48:34.826739','What was the first computer','DT:first JJ:machine','');
INSERT INTO "statement" VALUES (3191,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:48:34.831727','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
INSERT INTO "statement" VALUES (3192,'What is a microprocessor?','DT:chip','training','2023-03-27 20:48:34.832735',NULL,'','');
INSERT INTO "statement" VALUES (3193,'An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','training','2023-03-27 20:48:34.835732','What is a microprocessor?','DT:chip','');
INSERT INTO "statement" VALUES (3194,'A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','training','2023-03-27 20:48:34.840729','An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','');
INSERT INTO "statement" VALUES (3195,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:34.843730','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (3196,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:48:34.844730','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (3197,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:48:34.848731','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (3198,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:48:34.849733',NULL,'','');
INSERT INTO "statement" VALUES (3199,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','training','2023-03-27 20:48:34.852732','What is an operating system?','DT:operating NN:instrumentality','');
INSERT INTO "statement" VALUES (3200,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','training','2023-03-27 20:48:34.853733','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','');
INSERT INTO "statement" VALUES (3201,'Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','training','2023-03-27 20:48:34.855733','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','');
