INSERT INTO "statement" VALUES (3210,'Apple makes hardware and software to run on it. Microsft only makes operating systems. HP makes only computers. These are just few names among several hundred others.','NNP:makes VBZ:weaponry CC:code TO:travel_rapidly PRP:microsft RB:makes VBZ:direct VBG:instrumentality NNS:power_unit NNP:makes RB:machine JJ:defamation NNS:among IN:several JJ:large_integer CD:others','training','2023-03-27 20:48:34.873737','Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','');
INSERT INTO "statement" VALUES (3211,'Who uses super computers?','WP:uses VBZ:super JJR:machine','training','2023-03-27 20:48:34.874737',NULL,'','');
INSERT INTO "statement" VALUES (3212,'Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','training','2023-03-27 20:48:34.875737','Who uses super computers?','WP:uses VBZ:super JJR:machine','');
INSERT INTO "statement" VALUES (3213,'Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','training','2023-03-27 20:48:34.879737','Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','');
INSERT INTO "statement" VALUES (3214,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:48:34.881740','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
INSERT INTO "statement" VALUES (3215,'I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','training','2023-03-27 20:48:34.882738','Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','');
