INSERT INTO "statement" VALUES (3217,'How does a computer work?','DT:machine NN:activity','training','2023-03-27 20:48:34.885740',NULL,'','');
INSERT INTO "statement" VALUES (3218,'Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','training','2023-03-27 20:48:34.888742','How does a computer work?','DT:machine NN:activity','');
INSERT INTO "statement" VALUES (3219,'Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','training','2023-03-27 20:48:34.895744','Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','');
INSERT INTO "statement" VALUES (3220,'Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','training','2023-03-27 20:48:34.899744','Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','');
INSERT INTO "statement" VALUES (3221,'Just like everything it all comes down to math!','RB:kind IN:everything DT:travel TO:math','training','2023-03-27 20:48:34.902744','Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','');
