INSERT INTO "statement" VALUES (4601,'A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','training','2023-03-27 20:49:52.949823','An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','');
INSERT INTO "statement" VALUES (4602,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:49:52.952830','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (4603,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:49:52.952830','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (4604,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:49:52.956825','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (4605,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:49:52.957823',NULL,'','');
