INSERT INTO "statement" VALUES (6028,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:50:28.972759','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
INSERT INTO "statement" VALUES (6029,'I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','training','2023-03-27 20:50:28.973759','Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','');
