INSERT INTO "statement" VALUES (6031,'How does a computer work?','DT:machine NN:activity','training','2023-03-27 20:50:28.975760',NULL,'','');
INSERT INTO "statement" VALUES (6032,'Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','training','2023-03-27 20:50:28.978759','How does a computer work?','DT:machine NN:activity','');
INSERT INTO "statement" VALUES (6033,'Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','training','2023-03-27 20:50:28.982760','Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','');
INSERT INTO "statement" VALUES (6034,'Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','training','2023-03-27 20:50:28.984760','Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','');
INSERT INTO "statement" VALUES (6035,'Just like everything it all comes down to math!','RB:kind IN:everything DT:travel TO:math','training','2023-03-27 20:50:28.985767','Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','');
