INSERT INTO "statement" VALUES (7398,'What is a computer?','DT:machine','training','2023-03-27 20:51:25.248468',NULL,'','');
INSERT INTO "statement" VALUES (7399,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','training','2023-03-27 20:51:25.253475','What is a computer?','DT:machine','');
INSERT INTO "statement" VALUES (7400,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:51:25.255471','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
INSERT INTO "statement" VALUES (7401,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','training','2023-03-27 20:51:25.259469','The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','');
INSERT INTO "statement" VALUES (7402,'A device which maps one set of numbers onto another set of numbers.','DT:instrumentality WDT:represent VBZ:digit CD:collection IN:numbers NNS:onto IN:another DT:collection IN:numbers','training','2023-03-27 20:51:25.262472','An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','');
INSERT INTO "statement" VALUES (7403,'What is a super computer?','DT:super JJ:machine','training','2023-03-27 20:51:25.263471',NULL,'','');
INSERT INTO "statement" VALUES (7404,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','training','2023-03-27 20:51:25.268476','What is a super computer?','DT:super JJ:machine','');
INSERT INTO "statement" VALUES (7405,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','training','2023-03-27 20:51:25.274479','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','');
INSERT INTO "statement" VALUES (7406,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:51:25.276475','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
INSERT INTO "statement" VALUES (7407,'Who invented computers?','WP:create_by_mental_act VBD:machine','training','2023-03-27 20:51:25.277477',NULL,'','');
