INSERT INTO "statement" VALUES (7409,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:51:25.284475','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (7410,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:51:25.285475',NULL,'','');
