INSERT INTO "statement" VALUES (7412,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:51:25.294481','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
