INSERT INTO "statement" VALUES (7416,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:51:25.304480','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
