INSERT INTO "statement" VALUES (7431,'Apple makes hardware and software to run on it. Microsft only makes operating systems. HP makes only computers. These are just few names among several hundred others.','NNP:makes VBZ:weaponry CC:code TO:travel_rapidly PRP:microsft RB:makes VBZ:direct VBG:instrumentality NNS:power_unit NNP:makes RB:machine JJ:defamation NNS:among IN:several JJ:large_integer CD:others','training','2023-03-27 20:51:25.333487','Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','');
