INSERT INTO "statement" VALUES (7435,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:51:25.343495','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
