INSERT INTO "statement" VALUES (8811,'What is a computer?','DT:machine','training','2023-03-27 20:52:31.915907',NULL,'','');
INSERT INTO "statement" VALUES (8812,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','training','2023-03-27 20:52:31.920911','What is a computer?','DT:machine','');
INSERT INTO "statement" VALUES (8813,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:52:31.921927','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
INSERT INTO "statement" VALUES (8814,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','training','2023-03-27 20:52:31.924913','The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','');
INSERT INTO "statement" VALUES (8815,'A device which maps one set of numbers onto another set of numbers.','DT:instrumentality WDT:represent VBZ:digit CD:collection IN:numbers NNS:onto IN:another DT:collection IN:numbers','training','2023-03-27 20:52:31.927910','An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','');
INSERT INTO "statement" VALUES (8816,'What is a super computer?','DT:super JJ:machine','training','2023-03-27 20:52:31.929911',NULL,'','');
INSERT INTO "statement" VALUES (8817,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','training','2023-03-27 20:52:31.933912','What is a super computer?','DT:super JJ:machine','');
INSERT INTO "statement" VALUES (8818,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','training','2023-03-27 20:52:31.938912','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','');
INSERT INTO "statement" VALUES (8819,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:52:31.940913','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
INSERT INTO "statement" VALUES (8820,'Who invented computers?','WP:create_by_mental_act VBD:machine','training','2023-03-27 20:52:31.941913',NULL,'','');
INSERT INTO "statement" VALUES (8821,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','training','2023-03-27 20:52:31.943914','Who invented computers?','WP:create_by_mental_act VBD:machine','');
INSERT INTO "statement" VALUES (8822,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:52:31.948915','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (8823,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:52:31.949917',NULL,'','');
INSERT INTO "statement" VALUES (8824,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','training','2023-03-27 20:52:31.953916','What was the first computer','DT:first JJ:machine','');
INSERT INTO "statement" VALUES (8825,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:52:31.958917','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
INSERT INTO "statement" VALUES (8826,'What is a microprocessor?','DT:chip','training','2023-03-27 20:52:31.959916',NULL,'','');
INSERT INTO "statement" VALUES (8827,'An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','training','2023-03-27 20:52:31.962918','What is a microprocessor?','DT:chip','');
INSERT INTO "statement" VALUES (8828,'A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','training','2023-03-27 20:52:31.965919','An integrated circuit that implements the functions of a central processing unit of a computer.','DT:compound VBN:electrical_device WDT:use DT:mathematical_relation DT:central JJ:process NN:definite_quantity DT:machine','');
INSERT INTO "statement" VALUES (8829,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:52:31.969920','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (8830,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:52:31.971920','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (8831,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:52:31.975921','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (8832,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:52:31.976922',NULL,'','');
INSERT INTO "statement" VALUES (8833,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','training','2023-03-27 20:52:31.978922','What is an operating system?','DT:operating NN:instrumentality','');
INSERT INTO "statement" VALUES (8834,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','training','2023-03-27 20:52:31.980923','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','');
INSERT INTO "statement" VALUES (8835,'Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','training','2023-03-27 20:52:31.982922','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','');
INSERT INTO "statement" VALUES (8836,'Software which implements the basic functions of a computer, such as memory access, processes, and peripheral access.','WDT:use DT:basic JJ:mathematical_relation DT:computer, IN:representation NN:access, NN:processes, CC:peripheral JJ:right','training','2023-03-27 20:52:31.985924','Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','');
INSERT INTO "statement" VALUES (8837,'Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','training','2023-03-27 20:52:31.987923',NULL,'','');
INSERT INTO "statement" VALUES (8838,'It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','training','2023-03-27 20:52:31.988924','Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','');
INSERT INTO "statement" VALUES (8839,'I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','training','2023-03-27 20:52:31.989924','It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','');
INSERT INTO "statement" VALUES (8840,'Linux, always Linux!','NNP:always RB:linux','training','2023-03-27 20:52:31.990927','I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','');
INSERT INTO "statement" VALUES (8841,'What are you trying to accomplish. The OS should support your goals.','PRP:act TO:complete DT:orifice MD:support PRP$:content','training','2023-03-27 20:52:31.993926','Linux, always Linux!','NNP:always RB:linux','');
INSERT INTO "statement" VALUES (8842,'Name some computer company','DT:machine NN:institution','training','2023-03-27 20:52:31.994926',NULL,'','');
INSERT INTO "statement" VALUES (8843,'Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','training','2023-03-27 20:52:31.995927','Name some computer company','DT:machine NN:institution','');
INSERT INTO "statement" VALUES (8844,'Apple makes hardware and software to run on it. Microsft only makes operating systems. HP makes only computers. These are just few names among several hundred others.','NNP:makes VBZ:weaponry CC:code TO:travel_rapidly PRP:microsft RB:makes VBZ:direct VBG:instrumentality NNS:power_unit NNP:makes RB:machine JJ:defamation NNS:among IN:several JJ:large_integer CD:others','training','2023-03-27 20:52:31.999927','Do you mean hardware or software?','PRP:convey VB:weaponry CC:code','');
INSERT INTO "statement" VALUES (8845,'Who uses super computers?','WP:uses VBZ:super JJR:machine','training','2023-03-27 20:52:32.001927',NULL,'','');
INSERT INTO "statement" VALUES (8846,'Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','training','2023-03-27 20:52:32.003929','Who uses super computers?','WP:uses VBZ:super JJR:machine','');
INSERT INTO "statement" VALUES (8847,'Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','training','2023-03-27 20:52:32.008929','Anybody who wants to work with large numbers quickly with high accuracy.','WP:wants TO:work IN:large JJ:numbers NNS:quickly IN:high JJ:quality','');
INSERT INTO "statement" VALUES (8848,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:52:32.009929','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
INSERT INTO "statement" VALUES (8849,'I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','training','2023-03-27 20:52:32.010931','Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','');
INSERT INTO "statement" VALUES (8850,'You can definitely find few of them at NASA.','MD:definitely RB:find IN:independent_agency','training','2023-03-27 20:52:32.011932','I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','');
INSERT INTO "statement" VALUES (8851,'How does a computer work?','DT:machine NN:activity','training','2023-03-27 20:52:32.013931',NULL,'','');
INSERT INTO "statement" VALUES (8852,'Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','training','2023-03-27 20:52:32.016930','How does a computer work?','DT:machine NN:activity','');
INSERT INTO "statement" VALUES (8853,'Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','training','2023-03-27 20:52:32.020933','Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','');
INSERT INTO "statement" VALUES (8854,'Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','training','2023-03-27 20:52:32.022935','Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','');
INSERT INTO "statement" VALUES (8855,'Just like everything it all comes down to math!','RB:kind IN:everything DT:travel TO:math','training','2023-03-27 20:52:32.024934','Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','');
