INSERT INTO "statement" VALUES (10266,'What is a computer?','DT:machine','training','2023-03-27 20:58:45.772360',NULL,'','');
INSERT INTO "statement" VALUES (10267,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','training','2023-03-27 20:58:45.777365','What is a computer?','DT:machine','');
INSERT INTO "statement" VALUES (10268,'The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','training','2023-03-27 20:58:45.778371','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','DT:machine DT:electronic JJ:instrumentality WDT:act VBZ:message IN:digital JJ:word CC:performs DT:ordering IN:transaction NNS:based IN:predetermined JJ:manual TO:give DT:product','');
INSERT INTO "statement" VALUES (10269,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','training','2023-03-27 20:58:45.781372','The thing you''re using to talk to me is a computer.','DT:situation NN:using TO:communicate DT:machine','');
INSERT INTO "statement" VALUES (10270,'A device which maps one set of numbers onto another set of numbers.','DT:instrumentality WDT:represent VBZ:digit CD:collection IN:numbers NNS:onto IN:another DT:collection IN:numbers','training','2023-03-27 20:58:45.783373','An electronic device capable of performing calculations at very high speed and with very high accuracy.','DT:electronic JJ:instrumentality NN:capable IN:performing VBG:procedure RB:high JJ:rate RB:high JJ:quality','');
INSERT INTO "statement" VALUES (10271,'What is a super computer?','DT:super JJ:machine','training','2023-03-27 20:58:45.784367',NULL,'','');
INSERT INTO "statement" VALUES (10272,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','training','2023-03-27 20:58:45.788373','What is a super computer?','DT:super JJ:machine','');
INSERT INTO "statement" VALUES (10273,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','training','2023-03-27 20:58:45.793375','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','MD:perform RB:large JJ:numbers IN:procedure RB:high JJ:rate CC:quality VBP:label VBN:super JJ:machine','');
INSERT INTO "statement" VALUES (10274,'You know, the big iron!','PRP:know, DT:big JJ:metallic_element','training','2023-03-27 20:58:45.795367','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','DT:mainframe DT:machine WDT:direct IN:several JJ:command IN:magnatude NN:greater JJR:rate CC:capability IN:everyday JJ:general JJ:goal NN:computers, NN:kind DT:digit VBP:communicate','');
INSERT INTO "statement" VALUES (10275,'Who invented computers?','WP:create_by_mental_act VBD:machine','training','2023-03-27 20:58:45.796362',NULL,'','');
INSERT INTO "statement" VALUES (10276,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','training','2023-03-27 20:58:45.798370','Who invented computers?','WP:create_by_mental_act VBD:machine','');
INSERT INTO "statement" VALUES (10277,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','CD:strength MD:present IN:room NNP:von NNP:neumann NNP:create_by_mental_act VBD:machine PRP:know VBP:them, PRP:create_by_mental_act DT:princeton NNP:architecture, WDT:manual CC:collection NNS:assets JJ:representation NN:tract VBP:identify IN:discourse','training','2023-03-27 20:58:45.804371','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','DT:bit RB:ambigous CC:british JJ:person NN:charles NNP:babbage VBZ:think DT:parent IN:machine','');
INSERT INTO "statement" VALUES (10278,'What was the first computer','DT:first JJ:machine','training','2023-03-27 20:58:45.806365',NULL,'','');
INSERT INTO "statement" VALUES (10279,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','training','2023-03-27 20:58:45.810365','What was the first computer','DT:first JJ:machine','');
INSERT INTO "statement" VALUES (10280,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','PRP:could MD:express RB:first, JJ:primitive JJ:machine DT:jacquard NNP:loom, DT:programmable JJ:textile_machine WDT:used VBD:punchcards TO:keep DT:structure PRP:made DT:made DT:reprogrammable JJ:mechanical JJ:instrumentality','training','2023-03-27 20:58:45.814367','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','NNP:hard TO:say, DT:eniac VBZ:think DT:first JJ:''real'' POS:machine VBD:create IN:body IN:pennsylvania IN:1946','');
