INSERT INTO "statement" VALUES (10284,'The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','training','2023-03-27 20:58:45.823383','A really small circuit which stores instructions and performs calculations for the computer.','DT:really RB:small JJ:electrical_device WDT:mercantile_establishment NNS:manual CC:performs NNS:procedure DT:machine','');
INSERT INTO "statement" VALUES (10285,'The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','training','2023-03-27 20:58:45.825381','The heart of the computer, to put it simply.','DT:intuition DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (10286,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','DT:electronic JJ:part DT:environment VBP:relation DT:contiguous JJ:chemical_element NN:chip, NN:instead IN:discrete JJ:part NNS:attach DT:larger JJR:electrical_device NN:committee','training','2023-03-27 20:58:45.828376','The brain of a computer, to put it simply.','DT:neural_structure DT:computer, TO:move PRP:simply','');
INSERT INTO "statement" VALUES (10287,'What is an operating system?','DT:operating NN:instrumentality','training','2023-03-27 20:58:45.830383',NULL,'','');
INSERT INTO "statement" VALUES (10288,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','training','2023-03-27 20:58:45.832383','What is an operating system?','DT:operating NN:instrumentality','');
INSERT INTO "statement" VALUES (10289,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','training','2023-03-27 20:58:45.833385','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','WDT:arrange DT:weaponry JJ:environment DT:machine TO:travel_rapidly JJ:code VBZ:label DT:operating NN:system, DT:orifice','');
INSERT INTO "statement" VALUES (10290,'Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','training','2023-03-27 20:58:45.835372','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','NNP:macos, NNP:linux, NNP:unix... VBP:kind IN:orifice','');
INSERT INTO "statement" VALUES (10291,'Software which implements the basic functions of a computer, such as memory access, processes, and peripheral access.','WDT:use DT:basic JJ:mathematical_relation DT:computer, IN:representation NN:access, NN:processes, CC:peripheral JJ:right','training','2023-03-27 20:58:45.839379','Android and iOS are operating systems for mobile devices.','CC:ios VBP:direct VBG:instrumentality IN:mobile JJ:inclination','');
INSERT INTO "statement" VALUES (10292,'Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','training','2023-03-27 20:58:45.842374',NULL,'','');
INSERT INTO "statement" VALUES (10293,'It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','training','2023-03-27 20:58:45.843375','Which is better Windows or macOS?','VBZ:better RBR:operating_system CC:macos','');
INSERT INTO "statement" VALUES (10294,'I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','training','2023-03-27 20:58:45.845378','It depends on which machine you''re using to talk to me!','PRP:be WDT:device NN:using TO:communicate','');
INSERT INTO "statement" VALUES (10295,'Linux, always Linux!','NNP:always RB:linux','training','2023-03-27 20:58:45.846377','I''d prefer to not hurt your feelings.','NNP:like RB:cause_to_be_perceived PRP$:sensitivity','');
