INSERT INTO "statement" VALUES (10303,'Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','training','2023-03-27 20:58:45.863390','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','WP:needs TO:work IN:very, RB:large JJ:collection IN:collection IN:much JJ:shorter JJR:fundamental_quantity IN:case VBZ:feasible RBR:common JJ:machine NN:instrumentality','');
INSERT INTO "statement" VALUES (10304,'I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','training','2023-03-27 20:58:45.864385','Supercomputers are generally used by scientists and researchers.','VBP:generally RB:used IN:person CC:scientist','');
INSERT INTO "statement" VALUES (10305,'You can definitely find few of them at NASA.','MD:definitely RB:find IN:independent_agency','training','2023-03-27 20:58:45.865392','I bet the MET department uses them.','PRP:predict DT:met NNP:division NN:uses','');
INSERT INTO "statement" VALUES (10306,'How does a computer work?','DT:machine NN:activity','training','2023-03-27 20:58:45.866391',NULL,'','');
INSERT INTO "statement" VALUES (10307,'Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','training','2023-03-27 20:58:45.871386','How does a computer work?','DT:machine NN:activity','');
INSERT INTO "statement" VALUES (10308,'Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','training','2023-03-27 20:58:45.875387','Computers are very dumb. They only execute instructions given by humans.','RB:dumb RB:kill VBP:manual NNS:given IN:group','');
INSERT INTO "statement" VALUES (10309,'Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','training','2023-03-27 20:58:45.877389','Computers do everything asked of them by carrying out large numbers of basic mathematical operations very rapidly in sequence.','VBP:everything NN:communicate IN:move RP:large JJ:numbers IN:basic JJ:mathematical JJ:transaction RB:rapidly IN:series','');
INSERT INTO "statement" VALUES (10310,'Just like everything it all comes down to math!','RB:kind IN:everything DT:travel TO:math','training','2023-03-27 20:58:45.878393','Computers perform very large number of calculations to get the result.','NNS:perform RB:large JJ:amount IN:procedure TO:get DT:phenomenon','');
