BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "tag" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR(50),
	PRIMARY KEY("id"),
	UNIQUE("name")
);
CREATE TABLE IF NOT EXISTS "statement" (
	"id"	INTEGER NOT NULL,
	"text"	VARCHAR(255),
	"search_text"	VARCHAR(255) NOT NULL DEFAULT '',
	"conversation"	VARCHAR(32) NOT NULL DEFAULT '',
	"created_at"	DATETIME DEFAULT (CURRENT_TIMESTAMP),
	"in_response_to"	VARCHAR(255),
	"search_in_response_to"	VARCHAR(255) NOT NULL DEFAULT '',
	"persona"	VARCHAR(50) NOT NULL DEFAULT '',
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "tag_association" (
	"tag_id"	INTEGER,
	"statement_id"	INTEGER,
	FOREIGN KEY("tag_id") REFERENCES "tag"("id"),
	FOREIGN KEY("statement_id") REFERENCES "statement"("id")
);
COMMIT;
